import React from "react-dom";
import "./Home.css";
import NavBar from "./NavBar";
import Trades from "./Trades";
import UploadFile from "./UploadFile";


const url = process.env.BACK_END_URL || "http://localhost:8000";


function Home() {


    return (
        <div className="home">
            <NavBar />

            <main className="main">
            <Trades url={url} />    
            <UploadFile />
            </main>
        </div>
    );
}

export default Home;
